import React, { useState } from "react";
import CompanyProspectList from "./companyprospect";

export default function App() {
  const [data, setData] = useState([
    {
      nom: "Test Entreprise",
      adresse: "123 Rue Exemple, Paris",
      secteur: "IT",
      resume: "Entreprise fictive pour test",
      contacts: [
        { poste: "CEO", nom: "Alice", email: "alice@test.com", telephone: "0102030405", linkedin: "" }
      ],
      site_web: "",
      sources: ["Test"]
    }
  ]);

  console.log("DATA FRONT :", data);

  return (
    <div className="max-w-6xl mx-auto p-4">
      <h1 className="text-2xl font-bold mb-4">Test Affichage</h1>

      {data.length > 0 ? (
        <CompanyProspectList data={data} />
      ) : (
        <p>Aucune donnée à afficher</p>
      )}
    </div>
  );
}
